import React, { Component } from 'react';
import axios from 'axios';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import MenuItem from '@material-ui/core/MenuItem';
import { Button } from '@material-ui/core';

const baseUrl = 'http://localhost:3000/';

class AddPessoa extends Component { 
    
    state = {
        cidades: [], 
        cidade: '',
        estadosCivis: [], 
        estadoCivil: '',
        faixasEtarias: [], 
        faixaEtaria: '',
        fontes: [], 
        fonte:'',
        instrucoes: [], 
        instrucao:'',
        municipios: [],
         municipio:'',
        posicoesTrabalho: [], 
        posicaoTrabalho:'',
        profissoes: [], 
        profissao:'',
        rendas: [], 
        renda:'',
        ufs: [],
        uf:''
    }

    componentDidMount() {
        return axios.all([
                     axios.get(`${baseUrl}cidades`),
                     axios.get(`${baseUrl}estados_civis`),
                     axios.get(`${baseUrl}faixas_etarias`),
                     axios.get(`${baseUrl}fontes`),
                     axios.get(`${baseUrl}instrucoes`),
                     axios.get(`${baseUrl}municipios`),
                     axios.get(`${baseUrl}posicoes_trabalho`),
                     axios.get(`${baseUrl}profissoes`),
                     axios.get(`${baseUrl}rendas`),
                     axios.get(`${baseUrl}ufs`),
                    ])
                    .then(axios.spread((cidadesRes,
                                        estadosCivisRes,
                                        faixasEtariasRes,
                                        fontesRes,
                                        instrucoesRes,
                                        municipiosRes,
                                        posicoesTrabalhoRes,
                                        profissoesRes,
                                        rendasRes,
                                        ufsRes) => {
                            
                        this.setState({
                            cidades: cidadesRes.data,
                            estadosCivis: estadosCivisRes.data,
                            faixasEtarias: faixasEtariasRes.data,
                            fontes: fontesRes.data,
                            instrucoes: instrucoesRes.data,
                            municipios: municipiosRes.data,
                            posicoesTrabalho: posicoesTrabalhoRes.data,
                            profissoes: profissoesRes.data,
                            rendas: rendasRes.data,
                            ufs: ufsRes.data    
                        })
                    }));                      
    };

    selectCidade = () => (
        this.state.cidades.map( cidade => (
            <MenuItem key={cidade.codigo_cidade} value={cidade.nome_cidade}>
                {cidade.nome_cidade}
            </MenuItem>
        ))
    );
    
    selectUf = () => (
        this.state.ufs.map( uf => (
          <MenuItem key={uf.codigo_UF} value={uf.nome_UF}>
            {uf.nome_UF}
          </MenuItem>  
        ))
    );        

    selectFaixaEtaria = () => (
        this.state.faixasEtarias.map( faixaEtaria => (
            <MenuItem key={faixaEtaria.codigo_faixa_etaria} value={faixaEtaria.descricao_faixa_etaria}>
                {faixaEtaria.descricao_faixa_etaria}
            </MenuItem>
        ))
    );        
    
    selectFontes = () => (
        this.state.fontes.map(fonte => (
            <MenuItem key={fonte.codigo_fonte} value={fonte.descricao_fonte}>
                {fonte.descricao_fonte}
            </MenuItem>
        ))
    );

    selectEstadoCivil = () => (
        this.state.estadosCivis.map(estadoCivil => (
            <MenuItem key={estadoCivil.codigo_estado_civil} value={estadoCivil.descricao_estado_civil}>
                {estadoCivil.descricao_estado_civil}
            </MenuItem>
        ))
    )

    selectInstrucoes = () => (
        this.state.instrucoes.map(instrucao => (
            <MenuItem key={instrucao.codigo_instrucao} value={instrucao.descricao_instrucao}>
                {instrucao.descricao_instrucao}
            </MenuItem>
        ))
    )

    selectMunicipios = () => (
        this.state.municipios.map(municipio => (
            <MenuItem key={municipio.codigo_municipio} value={municipio.nome_municipio}>
                {municipio.nome_municipio}
            </MenuItem>
        ))
    )

    selectPosicoesTrabalho = () => (
        this.state.posicoesTrabalho.map(posicaoTrab => (
            <MenuItem key={posicaoTrab.codigo_posicao_trabalho} value={posicaoTrab.descricao_posicao_trabalho}>
                {posicaoTrab.descricao_posicao_trabalho}
            </MenuItem>
        ))
    )

    render() {
        return(
            <Dialog
            open={this.props.open}
            >
                <DialogTitle>Adicionar</DialogTitle>
                <DialogContent>
                <DialogContentText>
                    Preencha os campos abaixo para adicionar uma nova pessoa
                </DialogContentText>
                    <TextField
                        autoFocus
                        margin="dense"
                        id="nome"
                        label="Nome"
                        type="text"
                        fullWidth
                    />
                    <TextField
                        margin="dense"
                        id="cpf"
                        label="CPF"
                        type="text"
                        fullWidth
                    />
                    <TextField
                        margin="dense"
                        id="email"
                        label="Email"
                        type="email"
                        fullWidth
                    />
                    <TextField
                        margin="dense"
                        id="telefone"
                        label="Telefone"
                        type="text"
                        fullWidth
                    />
                    <TextField
                        margin="dense"
                        id="celular"
                        label="Celular"
                        type="text"
                        fullWidth
                    />  
                    <TextField
                        margin="dense"
                        id="cep"
                        label="CEP"
                        type="text"
                        fullWidth
                    />
                    <TextField
                        select
                        value = {this.state.uf}
                        onChange={(event) => {
                            this.setState({uf: event.target.value});
                        }}
                        margin="dense"
                        id="uf"
                        label="UF"
                        type="text"
                        fullWidth
                    >
                        {this.selectUf()}
                    </TextField>
                    <TextField
                        select
                        value = {this.state.faixaEtaria}
                        onChange={(event) => {
                            this.setState({faixaEtaria: event.target.value})
                        }}
                        margin="dense"
                        id="faixaEtaria"
                        label="Faixa Etária"
                        type="value"
                        fullWidth
                    >   
                        {this.selectFaixaEtaria()}
                    </TextField>
                    <TextField
                        select
                        value = {this.state.cidade}
                        onChange={(event) => {
                            this.setState({cidade: event.target.value});
                            }}
                        margin="dense"
                        id="cidade"
                        label="Cidade"
                        type="text"
                        fullWidth
                    >
                        {this.selectCidade()}
                    </TextField>
                    <TextField
                        select
                        value = {this.state.fonte}
                        onChange={(event) => {
                            this.setState({fonte: event.target.value});
                            }}
                        margin="dense"
                        id="fontes"
                        label="Fontes"
                        type="text"
                        fullWidth
                    >   
                        {this.selectFontes()}
                    </TextField>
                    <TextField
                        select
                        value = {this.state.estadoCivil}
                        onChange={(event) => {
                            this.setState({estadoCivil: event.target.value});
                            }}
                        margin="dense"
                        id="estadoCivil"
                        label="Estado civil"
                        type="text"
                        fullWidth
                    >   
                        {this.selectEstadoCivil()}
                    </TextField>
                    <TextField
                        select
                        value = {this.state.instrucao}
                        onChange={(event) => {
                            this.setState({instrucao: event.target.value});
                            }}
                        margin="dense"
                        id="instrucoes"
                        label="Instruções"
                        type="text"
                        fullWidth
                    >   
                        {this.selectInstrucoes()}
                    </TextField>
                    <TextField
                        select
                        value = {this.state.municipio}
                        onChange={(event) => {
                            this.setState({municipio: event.target.value});
                            }}
                        margin="dense"
                        id="municipio"
                        label="Município"
                        type="text"
                        fullWidth
                    >
                        {this.selectMunicipios()}
                    </TextField>
                    <TextField
                        select
                        value = {this.state.posicaoTrabalho}
                        onChange={(event) => {
                            this.setState({posicaoTrabalho: event.target.value});
                            }}
                        margin="dense"
                        id="posicaoTrabalho"
                        label="posicaoTrabalho"
                        type="text"
                        fullWidth
                    >
                        {this.selectMunicipios()}
                    </TextField>
                    <TextField
                        margin="dense"
                        id="sexo"
                        label="Sexo"
                        type="text"
                        fullWidth
                    />
                    <TextField
                        InputLabelProps={{ shrink: true }}
                        margin="normal"
                        id="data_nascimento"
                        label="Data de nascimento"
                        type="date"
                        fullWidth
                    />       
                </DialogContent>
                <DialogActions>
                <Button onClick={() => this.props.close(false)} color="primary">
                    Cancelar
                </Button>
                <Button onClick={this.handleClose} color="primary">
                    Adicionar
                </Button>
                </DialogActions>
          </Dialog>
        );
    }
}   

export default (AddPessoa);
